import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import Layout from "../../components/layout";

export default function Category(props) {
  return (
    <Layout sidebar>
      <Container>
          <Row>
              <Col md={12}>
                  <div style={{}}>
                  <h3>Category</h3>
                  <button>Add</button>
                  </div>
                  
              </Col>
          </Row>
      </Container>
    </Layout>
  );
}
